<div id="Orba"><h1 id="Orba">Orba</h1></div>

<p>
La Terre. Apportée auprès de <a href="Naos.html">Naos</a> par <a href="Caracor.html">Caracor</a> sous ordre de <a href="Cindara.html">Cindara</a>. C'est le dernier oeuf de <a href="Töt.html">Töt</a>, la dernière surface qui n'est pas devenue une étoile. Les <a href="Eä.html">Eä</a> sont les premiers êtres à l'avoir faconnée, ainsi que <a href="Ogo.html">Ogo</a>.
